import SHOP_DATA from "./shop.data";
import ShopActionTypes from "./shop.type";

const INITAL_STATE ={
    collections:SHOP_DATA
}

const shopReducer =(state =INITAL_STATE,action)=>{
    switch (action.type) {
        default:
            return state
    }
}

export default shopReducer
